import React from "react";
import Layout from "../components/Layout";

export default class Slides extends React.Component {
  render() {
    return (
      <Layout>
        <section class="cart">
          <div class="cart__description">
            <i class="fas fa-shopping-cart"></i>
            <p class="cart__empty">your cart is empty</p>
          </div>
          <div class="cart__details">
            <p class="cart__phrase">
              have an account ?
              <a class="cart__login" href="/login.html">
                login
              </a>
              to view items in your cart
            </p>
          </div>

          <p class="cart__shopping">start shopping</p>

          <div class="cart__help">
            <p class="cart__chat">chat representative</p>
            <p class="cart__call">need help ? call us</p>
          </div>
        </section>
      </Layout>
    );
  }
}
